job_description:
Development of clinical analytics solutions supporting other LNRS Data Science and Clinical Analytics initiatives per company timelines;
Serving as subject matter expert (SME) for Clinical Analytics;
Transferring and explaining clinical concepts in a language acceptable to non-clinical members within the company, in particular to Product and Project Management, Software Developers, Client Services, Scientists, and executives;
Assistance with professional development of other Clinical Analytics team members through mentoring, training and information sharing;
Performance of other Clinical Informatics and Analytics duties as assigned.
Ability to manipulate clinical and other data in Oracle environment (SQL)
Develop clinical data elements in support of healthcare predictive modeling algorithms and advanced clinical analytics solutions
